// Find the min and max values of x and y among the data points
const xValues = dataPoints.map(point => point.x);
const yValues = dataPoints.map(point => point.y);
const minX = Math.min(...xValues);
const maxX = Math.max(...xValues);
const minY = Math.min(...yValues);
const maxY = Math.max(...yValues);

// Function to scale the data points to fit the canvas
function scalePoint(point) {
    const scaleX = canvas.width / (maxX - minX);
    const scaleY = canvas.height / (maxY - minY);
    return { x: (point.x - minX) * scaleX, y: canvas.height - (point.y - minY) * scaleY };
}

let startTime = null;
const animationTime = 5800; // Animation time in milliseconds (adjust as needed)

function animate(timestamp) {
    if (!startTime) {
        startTime = timestamp;
    }
    const elapsedTime = timestamp - startTime;
    const progress = Math.min(elapsedTime / animationTime, 1);

    ctx.clearRect(0, 0, canvas.width, canvas.height);

    const scaledStartPoint = scalePoint(dataPoints[0]);
    ctx.beginPath();
    ctx.moveTo(scaledStartPoint.x, scaledStartPoint.y);

    for (let i = 1; i < dataPoints.length * progress; i++) {
        const scaledPoint = scalePoint(dataPoints[i]);
        ctx.lineTo(scaledPoint.x, scaledPoint.y);
    }

    ctx.strokeStyle = "#3573bb"; // Set line color
    ctx.lineWidth = 1; // Set line width
    ctx.stroke(); // Draw the lines

    for (let i = 0; i < dataPoints.length * progress; i++) {
        const scaledPoint = scalePoint(dataPoints[i]);
        ctx.beginPath();
        ctx.arc(scaledPoint.x, scaledPoint.y, 0.5, 0, Math.PI * 2); // Change the circle size here
        ctx.fillStyle = "#3573bb"; // Set circle color
        ctx.fill(); // Draw the circle
    }

    if (progress < 1) {
        requestAnimationFrame(animate);
    } else {
        startTime = null; // Reset the start time for the next animation cycle
        requestAnimationFrame(animate);
    }
}

// Start the animation
animate();
